import {useState} from 'react'

const Tasks = () => {
    const [tasks, setTasks] = useState(
        [
            {
               id:1,
               text: 'CSE 485',
               day: 'Apr 3rd at 1:15pm',
               reminder: true, 
            },
            {
                id:2,
                text: 'CSE 465',
                day: 'Apr 4th at 2:50pm',
                reminder: false, 
            },
            {
                id:3,
                text: 'Dinner with friends',
                day: 'Apr 4th at 7:00pm',
                reminder: true, 
            }
        ]
    )
  return (
    <>
    {tasks.map((task) => (
        <h3 key={task.id}>{task.text}</h3>
    ))}
    </>
  )
}

export default Tasks
